const App = () => {
  // -----  GLOBAL STATES
  const [data, setData] = useState([]);
  // -----  fetching data
  fetch(url)
    .then((data) => data.json())
    .then((res) => console.log(res));
  return data.length === '0' ?
    (<div> loading { data.length} </div>)
    : (<div className='container'>
      <div className="row">
        Logo here      </div>
    </div>)
};
export default App;
